import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Find a "Your Profile" link using text selector (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    // Click the first "Your Profile" link if it exists (simulate navigation)
    if (profileLinks.length > 0) {
      await profileLinks[0].scrollIntoViewIfNeeded();
      await profileLinks[0].hover();
      // Take screenshot of the hovered link
      const step2 = path.join(screenshotsDir, 'step_2_profile_link.png');
      await page.screenshot({ path: step2 });
      screenshots.push(step2);
      // Simulate click (if navigation occurs, ignore, as it's SPA)
      await profileLinks[0].click();
    }

    // Wait for the profile page to render (look for .profile-header)
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of the profile section
    const step3 = path.join(screenshotsDir, 'step_3_profile_section.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract profile information
    const extractedData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return {};

      const img = profileHeader.querySelector('.profile-image');
      const name = profileHeader.querySelector('.profile-info h2');
      const username = profileHeader.querySelector('.profile-info .username');
      const bio = profileHeader.querySelector('.profile-info .bio');
      const stats = profileHeader.querySelectorAll('.profile-stats .stat-number');
      const statLabels = profileHeader.querySelectorAll('.profile-stats .stat-label');

      let statsObj = {};
      if (stats && statLabels && stats.length === statLabels.length) {
        for (let i = 0; i < stats.length; i++) {
          statsObj[statLabels[i].innerText.trim()] = stats[i].innerText.trim();
        }
      }

      return {
        fullName: name ? name.innerText.trim() : null,
        username: username ? username.innerText.trim() : null,
        bio: bio ? bio.innerText.trim() : null,
        profileImage: img ? img.src : null,
        stats: statsObj
      };
    });

    // Also extract Jun's recent reviews (titles only)
    const junReviewTitles = await page.evaluate(() => {
      const reviewSection = document.querySelector('.profile-sections .section:nth-child(2)');
      if (!reviewSection) return [];
      const titles = Array.from(reviewSection.querySelectorAll('.review-title')).map(el => el.textContent.trim());
      return titles;
    });
    extractedData.junReviewTitles = junReviewTitles;

    // Take screenshot of reviews section
    const reviewsSection = await page.$('.profile-sections .section:nth-child(2)');
    if (reviewsSection) {
      const step4 = path.join(screenshotsDir, 'step_4_reviews_section.png');
      await reviewsSection.screenshot({ path: step4 });
      screenshots.push(step4);
    }

    return {
      success: true,
      action: "Harvested Jun's user profile information and recent review titles",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
